import React, { useEffect, useState } from "react";
import axios from "axios";
const Photo = () => {
  return (
    <div>
      <div className="anima"></div>
      <style jsx>{`
        .anima {
          width: 100%;
          height: 200px;
          animation: show 2s infinite;
        }
        img {
          width: 100%;
        }
        @keyframes show {
          0% {
            background: black;
          }
          50% {
            background: #2a343c;
          }
          100% {
            background: black;
          }
        }
      `}</style>
    </div>
  );
};

export default Photo;
